import React from "react";
import "../Layout.css";

function Events() {
  return (
    <div className="events-container card">
      <h1>Kommande & Tidigare Evenemang</h1>
      <p>
        Här kan du se våra kommande och tidigare evenemang direkt från vår Facebook-sida.
        Om listan inte syns kan du <a href="https://www.facebook.com/KumlaSportfiske/events" target="_blank" rel="noreferrer">klicka här</a> för att öppna den på Facebook.
      </p>

      <div className="iframe-wrapper">
        <iframe
          src="https://www.facebook.com/plugins/page.php?href=https%3A%2F%2Fwww.facebook.com%2FKumlaSportfiske%2Fevents&tabs=events&width=500&height=800&small_header=false&adapt_container_width=true&hide_cover=false&show_facepile=true"
          width="100%"
          height="800"
          style={{ border: "none", overflow: "hidden", borderRadius: "12px", boxShadow: "0 6px 26px rgba(0,0,0,0.06)" }}
          scrolling="no"
          frameBorder="0"
          allowFullScreen={true}
          allow="autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share"
          title="Facebook Events"
        ></iframe>
      </div>
    </div>
  );
}

export default Events;
